(16, 'Harta', 'harta', '<h1>Cu ce mijloace de transport &icirc;n comun pot ajunge?</h1>\r\n\r\n<p>Metrou:</p>\r\n\r\n<ul>\r\n\t<li>Piața Muncii</li>\r\n</ul>\r\n\r\n<p>Tramvai:</p>\r\n\r\n<ul>\r\n\t<li>40, 56 (Stația Piata Hurmuzachi)</li>\r\n\t<li>10, 34 (Stația Mieilor)</li>\r\n\t<li>1, 10, 34 (Stația Piața Hurmuzachi)</li>\r\n</ul>\r\n\r\n<p>Autobuz:</p>\r\n\r\n<ul>\r\n\t<li>40, 56 (Stația Piata Hurmuzachi)</li>\r\n\t<li>10, 34 (Stația Mieilor)</li>\r\n\t<li>1, 10, 34 (Stația Piața Hurmuzachi)</li>\r\n</ul>\r\n\r\n<p>Adresă: B-dul Basarabia nr.21</p>\r\n\r\n<p>Program: 24/24 ore</p>\r\n\r\n<p>Telefon: 0733.123.123</p>\r\n\r\n<p><img alt="" src="/content/uploaded/harta simplificata v04+punctat.png" style="width: 1124px; height: 798px;" /></p>\r\n', 'harta', '2019-02-12 10:20:08', '2019-05-20 16:41:14', NULL, NULL, '96a93e63-51c2-417e-9e35-4e2e2a5d459b', NULL),
