(23, 'Ghidul Pacientului', NULL, '<p>Why does the destination collection gets cleared if there is one?* What I expect is to reuse the destination collection and then perform the mapping. This would be inline with the behavior of mapping to a single destination (where it overwrites the properties in the destination but leaves ignored properties intact.)</p>\r\n\r\n<p>* while writing this, an explanation came up; what should be done if the collections are not ordered or worse, are not equal in size. I can imagine that this is the reason a new collection is created, but on the other hand wouldn&#39;t it be more logical if it just worked like I did? And if the user has a mismatch of collections, isn&#39;t their fault? (The user could just pass a new collection in it for the original behavior.)</p>\r\n\r\n<p>Maybe this could be a new feature to allow for the same collection be used? Or maybe if it already exists, I&#39;d be happy to hear it.</p>\r\n', 'ghidul-pacientului', '2019-02-20 14:58:54', NULL, NULL, NULL, NULL, NULL),
