(4, 'SECTIA CLINICA PEDIATRIE 3', '<p style="margin-bottom:13px">&nbsp;</p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b><span lang="EN-US" style="font-size:14.0pt"><span style="line-height:115%">Patologie medicala pediatrica&nbsp; - </span></span></b><span lang="EN-US" style="font-size:14.0pt"><span style="line-height:115%">domenii de expertiza</span></span></span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:14.0pt"><span style="line-height:115%">In <i>compartimentul de pediatrie generala</i></span></span> se pot interna:</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">-forme usoare si medii de afectiuni respiratorii (infectii de cai respiratorii superioare, &nbsp;pneumonii bacteriene/virale, astm bronsic,bronsiolite,etc);</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">-forme usoare si medii de afectiuni acute digestive (stomatite, gastroenterocolite, dispepsii, sindroame de deshidratare acuta, etc);</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">- convulsii febrile</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">- sindroame febrile prelungite, <i>febre de origine neprecizata pentru investigatii</i>;???</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">- infectii urinare joase/ inalte (cistite/pielonefrite);</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">- copii cu patologie medicala care apartine unor specialitati conexe si sunt in evolutia unei afectiuni acute &nbsp;pediatrice.</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b>NU SE INTERNEAZA </b>boli acute febrile cu eruptie (posibile boli infectioase -contagioase, care se vor adresa specialitatii de boli infectioase) , copii cu boli diareice peste varsta de un an . </span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b>Platoul tehnic: </b>&nbsp;</span></span></span></p>\r\n\r\n<ul>\r\n\t<li><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">aparate pentru administrarea medicatiei pe cale inhalatorie , </span></span></span></li>\r\n\t<li><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">&nbsp;camera dedicata realizarii de tratamente medicale, </span></span></span></li>\r\n\t<li><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">aparatura de ultima generatie pentru recoltare de probe biologice (aparate Accuvein), </span></span></span></li>\r\n\t<li><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">aparatura pentru administrare tratamente perfuzabile in ritm constant. </span></span></span></li>\r\n\t<li><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Pulsoximetre portabile pentru evaluarea saturatiei O2</span></span></span></li>\r\n\t<li style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Ecograf Siemens Accuson S 2000 cu sonde lineare si convexe pentru realiazrea de ecografie abdominala, toracica si transfontanelara</span></span></span></li>\r\n</ul>\r\n\r\n<p style="margin-left:24px; margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b>Facilitati de cazare</b></span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Paturi cu posibilitate de modificare a pozitiei si inclinarii prin telecomanda.</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Disponibilitate de consola tehnica de administrare O2 pentru toate paturile din sectie </span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b>Investigatii</b> efectuate in compartimentul de pediatrie generala:</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">- analize de laborator efectuate in laboratorul spitalului (hematologie, biochimie, diverse);</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">-ecografie generala Ecocardiografie mod M, 2D, Doppler color si PW, CW, </span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b><span lang="EN-US" style="font-size:14.0pt"><span style="line-height:115%">Cardiologie pediatrica -&nbsp; </span></span></b><span lang="EN-US" style="font-size:14.0pt"><span style="line-height:115%">domenii de interes<b> </b></span></span></span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><i>Malformatii congenitale de cord cianogene si necianogene</i> &ndash; screening, evaluare &nbsp;noninvaziva&nbsp; si tratament medical</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><i>Patologie cardiaca dobandita la copil</i>: HTA, aritmii cardiace, dsilipidemii, hipertensiune pulmonara&nbsp; screening, evaluare &nbsp;noninvazivasi tratament medical</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Evaluare cardiologica la copii care desfasoara <i>activitati sportive</i></span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Evaluare cardiologica in patologia pediatrica cu <i>afectare cardiovasculara secundara.</i></span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Evaluare si monitorizare cardiologica a unor terapii medicamentoase care implica efecte adverse cardiovasculare</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">In compartimentul de cardiologie se pot <b>interna </b>copii pentru evaluare &nbsp;si tratament specific&nbsp; domeniilor&nbsp; mentionate mai sus. </span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><i>Toate serviciile de cardiologie se efectueaza numai cu programare prealabila.</i></span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b>Platoul tehnic al departamentului de cardiologie pediatrica</b>: </span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:normal"><span style="font-family:Calibri,sans-serif">Ecocardiograf&nbsp; Philips Affinity 70 G ecografiecardiaca mod M, 2D, Doppler spectral, Doppler Color,&nbsp;&nbsp;&nbsp; </span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Aparat ECG cu inregistrare pe&nbsp; 12 canale</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">&nbsp;2 aparate monitorizare Holter ECG BTL CardioPoint Holter-H600</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">&nbsp; Aparat monitorizare tensiune arteriala BTL-08 ABPM SW</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">&nbsp;2 aparate monitorizare tensiune arteriala MortaraAmbulo 2400</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b>Servicii medicale</b> realizate in departamentul de cardiologie pediatrica: </span></span></span></p>\r\n\r\n<ul>\r\n\t<li><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Ecocardiografie mod M, 2D, Doppler color si PW, CW, </span></span></span></li>\r\n\t<li><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Ekg de repaus</span></span></span></li>\r\n\t<li style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">&nbsp;Monitorizare 24 h Holter EKG si TA</span></span></span></li>\r\n</ul>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b>Mod de realizare</b> al serviciilor medicale in Sectia 3 Pediatrie</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Internarile se efectueaza in regim de spitalizare de zi sau de spitalizare continua, in urgenta sau cu bilet de trimitere .</span></span></span></p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b>Documente necesare pentru internare:</b></span></span></span></p>\r\n\r\n<ul>\r\n\t<li><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">&nbsp;bilet de trimitere de la medicul de famile sau medicul specialist (in afara situatiilor de urgenta</span></span></span></li>\r\n\t<li style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">&nbsp;copie dupa certificatul de nastere.</span></span></span></li>\r\n</ul>\r\n\r\n<p style="margin-bottom:13px">&nbsp;</p>\r\n\r\n<p style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><b><i>Contact sectie clinica PEDIATRIE 3:</i></b></span></span></span></p>\r\n\r\n<ul>\r\n\t<li><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Pentru Pediatrie generala:&nbsp;&nbsp;&nbsp; Tel PROGRAMARI: MIERCURI, intre 12:00-14:00 la la 0314136700 int 301</span></span></span></li>\r\n\t<li style="margin-bottom:13px"><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif">Pentru cardiologie:Tel. PROGRAMARI: MARTI, Dr. Ghiorghiu intre 11:00-13:00 (exclusiv pentru programarea internarilor) la 0314136700 int &nbsp;880</span></span></span></li>\r\n</ul>\r\n', NULL, NULL, NULL, '0', '2019-04-15 14:21:48', '2019-05-31 15:58:25', NULL, '96a93e63-51c2-417e-9e35-4e2e2a5d459b', '96a93e63-51c2-417e-9e35-4e2e2a5d459b', NULL, '/content/uploaded/7 sectii.svg'),
(5, 'COMPARTIMENT PEDIATRIE GENERALA', NULL, NULL, 4, NULL, NULL, '2019-04-15 15:19:07', '2019-04-15 15:31:32', NULL, '96a93e63-51c2-417e-9e35-4e2e2a5d459b', '96a93e63-51c2-417e-9e35-4e2e2a5d459b', NULL, NULL),
(6, 'COMPARTIMENT CARDIOLOGIE', NULL, NULL, 4, NULL, NULL, '2019-04-15 15:54:44', '2019-04-15 16:48:36', NULL, '96a93e63-51c2-417e-9e35-4e2e2a5d459b', '1e426daf-0404-41d4-ab53-6300b4f83a6c', NULL, NULL),
(7, 'CHIRURGIE PEDIATRICĂ', '<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><b><span style="font-size:10.0pt"><span style="line-height:107%">Prezentarea secției</span></span></b></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Secția se află la etajul 4 și are o capacitate de 25 de paturi pentru spitalizarea continuă. Cele 25 de paturi sunt distribuite &icirc;n 8 saloane (5 saloane cu 4 paturi, 2 saloane cu 2 paturi și 1 rezervă). Fiecare salon este dotat cu grup sanitar propriu și televizor.</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Blocul operator pentru chirurgie este situat la etajul 5 și constă &icirc;n 3 săli de operație dotate cu aparatură ultramodernă (instrumentar pentru chirurgie deschisă, linie pentru chirurgie minim invazivă &ndash; laparoscopie, toracoscopie, endourologie, endoscopie digestivă inferioară si superioară), ce permite efectuarea intervențiilor din sfera chirurgiei pediatrice.</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px">&nbsp;</p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><b><span style="font-size:10.0pt"><span style="line-height:107%">Ce oferim?</span></span></b></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Patologie chirurgicala curentă &ndash; hernie inghinală, hidrocel, testicul necobor&acirc;t, hernie ombilicală, hernie de linie albă, fimoză, etc.;</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Patologie abdominală &ndash; apendicită, patologie anexială, diverticul Meckel, litiază biliară, invaginație intestinală, ocluzii intestinale, chist hidatic, chist splenic, stenoză de pilor, etc.;</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Patologie urologică &ndash; sindrom de joncțiune pieloureterală, reflux vezicoureteral, megaureter obstructiv, hipospadias, diverticul vezical, valvă de uretră, chist renal, litiază renală, etc.;</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Patologie toracică &ndash; malformații congenitale bronhopulmonare (CPAM, sechestrație pulmonară, emfizem lobar congenital, chist bronhogenic), pleurezii, pneumotorax, chilotorax, etc.;</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Leziuni cutanate &ndash; hemangioame, nevi pigmentari, chisturi dermice, tumorete, infecții cutanate (abces, flegmon, celulite), etc.;</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Patologie tumorală malignă sau benignă;</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px">&nbsp;</p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px">&nbsp;</p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><b><span style="font-size:10.0pt"><span style="line-height:107%">Cum ajungeți la noi?</span></span></b></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Accesarea serviciilor oferite se realizează printr-o consultație inițială &icirc;n cabinetul de chirurgie din ambulatoriul integrat sau, &icirc;n cazul unei urgențe, prin camera de gardă. Ulterior, &icirc;n cazul &icirc;n care este necesară internarea, pacientul este &icirc;ndrumat către biroul de internări pentru formalitățile de internare, apoi este condus pe secția de chirurgie de la etajul 4, unde este preluat de asistentele noastre.</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">De asemenea, ne puteți contacta telefonic la numerele 031.4136700&nbsp;/&nbsp;031.4136701&nbsp;/&nbsp;031.4136702&nbsp;/&nbsp;031.4136703, interior 922, 920.</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px">&nbsp;</p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><b><span style="font-size:10.0pt"><span style="line-height:107%">De ce acte aveți nevoie?</span></span></b></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Pentru consultație &icirc;n ambulatoriu este necesar un bilet de trimitere către Chirurgie, eliberat de medicul de familie, și de o copie a certificatului de naștere sau a cărții de identitate.</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">&Icirc;n cazul consulturilor prin camera de gardă este necesară doar o copie a certificatului de naștere sau a cărții de identitate.</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Indiferent că vă prezentați &icirc;n ambulatoriu sau la camera de gardă vă rugăm să aveți la dumneavoastră toate actele medicale aferente patologiei chirurgicale, dacă există (bilete de externare, investigații imagistice, etc.).</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">De asemenea, &icirc;n cazul unei internări, dacă părintele dorește concediu medical, acesta poate fi eliberat doar pacienților cu v&acirc;rsta sub 7 ani și &icirc;n baza unei adeverințe de salariat de la locul de muncă.&shy;&shy;&shy;&shy;&shy;&shy;&shy;&shy;</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px"><span style="font-size:11pt"><span style="line-height:107%"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt"><span style="line-height:107%">Patologie traumatică &ndash; plăgi, corpi străini, etc.</span></span></span></span></span></p>\r\n\r\n<p style="text-align:justify; margin-bottom:11px">&nbsp;</p>\r\n', NULL, NULL, NULL, NULL, '2019-04-24 08:15:17', NULL, NULL, '0df6e890-8524-4e0a-bd00-6661ae0ae591', NULL, NULL, NULL);


