(1, 'dsa', 'dsa', '<h1>Cu ce mijloace de transport &icirc;n comun pot ajunge?</h1>\r\n\r\n<p>Metrou:</p>\r\n\r\n<ul>\r\n\t<li>Piața Muncii</li>\r\n</ul>\r\n\r\n<p>Tramvai:</p>\r\n\r\n<ul>\r\n\t<li>40, 56 (Stația Piata Hurmuzachi)</li>\r\n\t<li>10, 34 (Stația Mieilor)</li>\r\n\t<li>1, 10, 34 (Stația Piața Hurmuzachi)</li>\r\n</ul>\r\n\r\n<p>Autobuz:</p>\r\n\r\n<ul>\r\n\t<li>40, 56 (Stația Piata Hurmuzachi)</li>\r\n\t<li>10, 34 (Stația Mieilor)</li>\r\n\t<li>1, 10, 34 (Stația Piața Hurmuzachi)</li>\r\n</ul>\r\n\r\n<p>Adresă: B-dul Basarabia nr.21</p>\r\n\r\n<p>Program: 24/24 ore</p>\r\n\r\n<p>Telefon: 0733.123.123</p>\r\n\r\n<p><img alt="Harta" src="src/img/Harta/harta.jpg" /></p>\r\n', NULL, '2019-02-12 12:08:27', '2019-02-14 10:44:41', '2019-02-25 18:01:26', NULL, NULL, NULL, NULL),
(2, 'art1', NULL, '<p>sdafd</p>\r\n', '321', '2019-02-14 09:19:20', '2019-02-20 14:54:51', '2019-03-13 10:51:59', NULL, NULL, 'aeedc087-c914-4fd3-b557-7bb4500e7846', '\\content\\uploaded\\2018-12-07 at 15-33-27.png'),
(3, 'Relatii virtuale', NULL, '<p>These virtual relationships are imposed from outside by the DreamFactory platform. There is no need to change the actual configuration of your database. What&rsquo;s more, once DreamFactory knows about the virtual relationships, you can work with related data of any kind without the need for server-side scripting. This feature packs even more capability into the request URL string itself, further reducing the need to build custom REST&nbsp;</p>\r\n', 'Test short', '2019-02-20 14:28:30', '2019-02-20 14:28:54', '2019-03-13 10:51:59', NULL, NULL, 'aeedc087-c914-4fd3-b557-7bb4500e7846', '\\content\\uploaded\\2019-02-13 at 19-10-22.png'),
(4, 'dasnans', 'dosndo', '<p>nsdkjfnkdsnjffds</p>\r\n', NULL, '2019-03-13 09:02:34', NULL, '2019-03-13 09:02:55', '0df6e890-8524-4e0a-bd00-6661ae0ae591', NULL, '0df6e890-8524-4e0a-bd00-6661ae0ae591', '/content/uploaded/Screenshot 2019-03-13 at 11.24.05.png'),
(5, 'CENTRALIZATOR CU REZULTATUL SELECTIEI DOSARELOR INSCRISE LA CONCURSUL ORGANIZAT PENTRU OCUPAREA UNOR POSTURI VACANTE DE REGISTRATORI MEDICALI', NULL, '<p>13.03.2019 &ndash; CENTRALIZATOR CU REZULTATUL SELECTIEI DOSARELOR INSCRISE LA CONCURSUL ORGANIZAT PENTRU OCUPAREA UNOR POSTURI VACANTE DE REGISTRATORI MEDICALI</p>\r\n', NULL, '2019-03-13 10:55:34', NULL, NULL, 'aeedc087-c914-4fd3-b557-7bb4500e7846', NULL, NULL, '/content/uploaded/IMG_5904.JPG'),
(6, 'PROTECTIA DATELOR CU CARACTER PERSONAL', 'PROTECTIA DATELOR CU CARACTER PERSONAL', '<p>In conformitate cu Regulamentul general al Uniunii Europene privind protectia datelor (Regulamentul UE 2016/679, &ldquo;GDPR&rdquo;) care este aplicabil din data de 25 mai 2018,&nbsp;<a href="http://spitalgomoiu.ro/spital/">Spitalul clinic de copii Dr. Victor Gomoiu&nbsp;</a>,este operator de date cu caracter personal si va informeaza dupa cum urmeaza:</p>\r\n\r\n<p>Pentru a presta serviciile de sanatate&nbsp;<a href="http://spitalgomoiu.ro/spital/">Spitalul clinic de copii Dr. Victor Gomoiu&nbsp;</a>&nbsp;prelucreaza datele dumneavoastra personale: codul numeric personal, seria si numarul actului de identitate, date privind sanatatea inclusiv istoricul medical, si alte date,dar fara a se limita la cele de pe copia actului de identitate, copia certificatului de nastere sau de pe alte documente de identificare, dupa caz, date privind viata sexuala. In consecinta, fara a avea la dispozitie datele dumneavoastra cu caracter personal necesare,&nbsp;<a href="http://spitalgomoiu.ro/spital/">Spitalul clinic de copii Dr. Victor Gomoiu&nbsp;</a>&nbsp;nu va putea sa se conformeze in ceea ce priveste respectarea prevederilor legale in prestarea serviciilor medicale, acest lucru neafectand totusi calitatea actului medical.</p>\r\n\r\n<p>Datele dumneavoastra cu caracter personal pot fi transferate catre: autoritati de stat, asociatii profesionale, furnizori de servicii (clinici, consultanti, experti, dezvoltatori de servicii IT, societati de arhivare).</p>\r\n\r\n<p><u>Incepand cu 25 mai 2018 aveti urmatoarele drepturi</u>&nbsp;ce rezulta din Regulamentul UE privind protectia datelor cu caracter personal:</p>\r\n\r\n<ul>\r\n\t<li>Dreptul de Acces&nbsp;&ndash; puteti solicita accesul la datele dvs. cu caracter personal;</li>\r\n\t<li>Dreptul de Rectificare sau de actualizare&nbsp;&ndash; puteti solicita companiei sa corecteze datele dvs. cu caracter personal care sunt inexacte sau incomplete;</li>\r\n\t<li>Dreptul de Ştergere&ndash; puteti solicit sa fie sterse datele dvs. cu caracter personal in cazul in care se aplica unul dintre urmatoarele temeiuri:\r\n\t<ul>\r\n\t\t<li>Atunci cand datele cu caracter personal nu mai sunt necesare in legatura cu scopurile pentru care au fost colectate sau prelucrate;</li>\r\n\t\t<li>Daca nu exista alt temei juridic pentru prelucrare;</li>\r\n\t\t<li>Va opuneti procesului decizional automatizat si nu exista temeiuri juridice intemeiate;</li>\r\n\t\t<li>Datele cu caracter personal au fost prelucrate ilegal;</li>\r\n\t\t<li>Datele cu caracter personal trebuie sa fie sterse pentru a respecta obligatia legala in temeiul dreptului Uniunii sau al dreptului intern care se aplica spitalului;</li>\r\n\t</ul>\r\n\t</li>\r\n\t<li>Dreptul de Restrictionare&nbsp;&ndash; puteti solicita sa restrictioneze modul in care prelucreaza datele dvs. cu caracter personal in cazul in care se aplica unul dintre urmatoarele:\r\n\t<ul>\r\n\t\t<li>Contestati exactitatea datelor dvs. cu caracter personal, pentru o perioada care sa permita spitalului sa verifice exactitatea datelor dvs. cu caracter personal;</li>\r\n\t\t<li>Prelucrarea este ilegala si va opuneti stergerii datelor cu caracter personal si solicitati in schimb restrictia de utilizare a acestora;</li>\r\n\t\t<li><a href="http://spitalgomoiu.ro/spital/">Spitalul clinic de copii Dr. Victor Gomoiu&nbsp;</a>nu mai are nevoie de datele cu caracter personal in scopul prelucrarii, dar ele sunt solicitate de dvs. pentru constatarea, exercitarea sau apararea unui drept in justitie;</li>\r\n\t\t<li>V-ati opus prelucrarii in conformitate cu dreptul de a obiecta si procesului decizional automatizat, in asteptarea verificarii daca temeiurile legitime ale spitalului prevaleaza asupra temeiurilor dvs.</li>\r\n\t</ul>\r\n\t</li>\r\n\t<li>Dreptul la Portabilitate &ndash; puteti solicita spitalului primirea datelor dvs. cu caracter personal intr-un format structurat, utilizat in mod curent, prelucrabil automat sau, in masur in care este posibil din punct de vedere tehnic, &nbsp;sa transfere datele dvs. cu caracter personal catre o alta organizatie;</li>\r\n\t<li>Dreptul de a obtine confirmarea cu privire la faptul ca datele cu caracter personal referitoare la Dvs. sunt sau nu prelucrate si comunicate intr-o forma inteligibila;</li>\r\n\t<li>Dreptul de va modifica sau retrage consimtamantului. Acest drept se aplica numai daca a fost colectat consimtamantul dvs. &ndash; va puteti retrage oricand consimtamantul &nbsp;pentru prelucrarea datelor dvs. cu caracter personal pentru care v-ati dat consimtamantul, fara a aduce atingere legalitatii consimtamantului dat inainte de revocare;</li>\r\n\t<li>Dreptul la opozitie &ndash; puteti sa va opuneti prelucrarii datelor dvs. cu caracter personal care o privesc, cu exceptia cazului in care&nbsp;<a href="http://spitalgomoiu.ro/spital/">Spitalul clinic de copii Dr. Victor Gomoiu&nbsp;</a>demonstreaza ca are motive legitime care justifica prelucrarea;</li>\r\n\t<li>Dreptul de a vi se comunica orice rectificare sau stergere sau restrictionare a prelucrarii;</li>\r\n\t<li>Dreptul de a fi notificat in caz de incalcare a securitatii datelor;</li>\r\n\t<li>Dreptul sa depuneti o plangere la Autoritatea Nationala de Supraveghere a Prelucrarii Datelor cu Caracter Personal.</li>\r\n</ul>\r\n\r\n<p>Va rugam ca, in cazul in care, in vederea executarii serviciilor medicale ne transmiteti (si) datele cu caracter personal ale altei persoane, sa comunicati prezenta Informare persoanei respective. In cazul in care datele cu caracter personal comunicate sunt ale unui minor, parintele sau tutorele va fi cel informat pentru copilul minor.</p>\r\n\r\n<p>Pentru orice solicitari pe care le puteti avea cu privire la exercitarea drepturilor mentionate mai sus sau la retragerea consimtamantului, precum si pentru a ne adresa orice alte intrebari privitoare la cele comunicate prin prezenta, puteti sa contactati&nbsp;<a href="http://spitalgomoiu.ro/spital/">Spitalul clinic de copii Dr. Victor Gomoiu&nbsp;</a>la adresa de e-mai&nbsp;<a href="mailto:protectiadatelor@spitalgomoiu.ro">protectiadatelor@spitalgomoiu.ro</a>,&nbsp;in atentia Responsabilului cu Protectia Datelor.</p>\r\n', ' ', '2019-04-09 09:32:07', NULL, '2019-04-09 09:50:22', '0df6e890-8524-4e0a-bd00-6661ae0ae591', NULL, '0df6e890-8524-4e0a-bd00-6661ae0ae591', '/content/uploaded/blog-gdpr_r.jpg'),
(7, 'Povestea spitalului din Bariera Vergului', 'Povestea spitalului din Bariera Vergului', '<h2><strong>Povestea spitalului din Bariera Vergului</strong></h2>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;Planurile spitalului au fost elaborate initial de&nbsp;<a href="https://ro.wikipedia.org/wiki/Gheorghe_Simotta"><strong>Gheorghe Simotta</strong></a>, arhitect celebru in vreme, care a trait intre anii 1891-1979 si din creatia caruia fac parte Palatul Patriarhiei, Biserica Schitu Darvari si alte cladiri care au dat farmec Bucurestiului interbelic.</em></p>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;Ideea ridicarii spitalului i-a apartinut profesorului&nbsp;<a href="https://ro.wikipedia.org/wiki/Victor_Gomoiu"><strong>doctor</strong>&nbsp;<strong>Victor Gomoiu</strong></a>, care, dupa un studiu temeinic, a trasat cu mana sa planurile de constructie, modificandu-le el insusi pe cele initiale ale arhitectului Simotta. A luat astfel nastere un complex de servicii medicale gratuite, impresionant pentru acea vreme, cu cinci mari specialitati medicale: boli interne, chirurgie, obstetrica-ginecologie, pediatrie si stomatologie. Locul ales pentru constructia noului spital a fost mult criticat, inclusiv din cauza lipsei unei surse de apa accesibile.</em></p>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;Banii pentru acest amplu proiect, in egala masura opera de caritate, au fost obtinuti cu mari insistente, prin subscriptii publice, de la Banca Nationala, CFR, Ministerul Muncii precum si Ministerul Sanatatii. In schimbul acestor fonduri, profesorul Victor Gomoiu s-a angajat sa acorde asistenta medicala gratuita angajatilor acestor institutii pe o perioada de 10 ani.</em></p>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;Asezamintele medico-sociale &bdquo;Sfanta Elena&rdquo;, fondate de Victor Gomoiu, au fost conduse si organizate de el atat de bine incat Sectia Sanitara a Ligii Natiunilor Unite de la Geneva le-a recomandat ca model. Acest complex de asistenta medico-sociala avea in componenta sa 10 cabinete de specialitati diferite, doua laboratoare, o farmacie si 60 de paturi pentru bolnavi. El a fost dat in folosinta in anul 1927, director fiind prof. Victor Gomoiu.</em></p>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;In perioada interbelica spitalul s-a bucurat de mare popularitate, mai cu seama in randul populatiei sarace de la periferia Bucurestiului. Dupa cel de-al doilea razboi mondial, spitalul a avut o destinatie exclusiv pediatrica, iar denumirea sa a devenit Spitalul de Copii &bdquo;23 August&rdquo;.</em></p>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;Denumirea actuala, respectiv Spitalul Clinic de Copii &bdquo;Dr. Victor Gomoiu&rdquo;, atribuita din 1990, reprezinta o reparatie si un omagiu pentru omul si medicul de exceptie care a fost profesorul Victor Gomoiu.</em></p>\r\n\r\n<p><em>&nbsp; &nbsp; In acest spital si-au desfasurat activitatea in anii &rsquo;70 si mai apoi din anii &rsquo;90 pana in prezent nume celebre ale pediatriei romanesti, incepand cu prof. dr Valeriu Popescu, continuand cu prof. dr. Dimitrie Dragomir, prof. dr. Constantin Arion.</em></p>\r\n\r\n<p><em>Noi, cei de azi, am invatat de la ei. Incercam, la randul nostru, sa-i invatam pe cei de maine.</em></p>\r\n\r\n<p><a href="http://spitalgomoiu.ro/wp-content/uploads/2016/09/Gomoiu_old_4.jpg"><img alt="" height="329" sizes="(max-width: 418px) 100vw, 418px" src="http://spitalgomoiu.ro/wp-content/uploads/2016/09/Gomoiu_old_4-300x236.jpg" srcset="http://spitalgomoiu.ro/wp-content/uploads/2016/09/Gomoiu_old_4-300x236.jpg 300w, http://spitalgomoiu.ro/wp-content/uploads/2016/09/Gomoiu_old_4.jpg 509w" width="418" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>In prezent spitalul are in componenta urmatoarele sectii:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n\t<li><em>Sectia pediatrie cu urmatoarele compartimente: Terapie acuta,&nbsp;Gastroenterologie pediatrica, Alergologie</em></li>\r\n\t<li><em>Sectia neurologie pediatrica</em></li>\r\n\t<li><em>Spitalizare zi &ndash;&nbsp;recuperare neurologie pediatrica</em></li>\r\n\t<li><em>Sectia O.R.L.</em></li>\r\n\t<li><em>Laborator de radiologie si imagistica medicala</em></li>\r\n\t<li><em>Laborator analize medicale</em></li>\r\n\t<li><em>Laborator de explorari functionale</em></li>\r\n\t<li><em>Ambulatoriu de specialitate</em></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;Principalele servicii medicale sunt cele in domeniile: alergologie, gastroenterologie, neurologie pediatrica, ORL, kinetoterapie pediatrica, pediatrie, neuropsihiatrie infantila, radiologie &ndash; imagistica medicala.</em></p>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;De asemenea spitalul asigura activitati de educatie academica si de cercetare &icirc;n domeniul medical, fiind afiliat&nbsp;<a href="http://umfcd.ro/">Universitatii de Medicina si Farmacie &ldquo;Carol Davila&rdquo;</a>&nbsp;din Bucuresti.</em></p>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;Incepand cu aprilie 2011, Spitalul Clinic de Urgenta pentru Copii &ldquo;Dr. Victor Gomoiu&rdquo; se afla in subordinea&nbsp;<a href="http://pmb.ro/">Primariei Municipiului Bucuresti (PMB)</a>&nbsp;si a A<a href="http://assmb.ro/">dministratia Spitalelor si Serviciilor Medicale din Bucuresti(ASSMB)</a>. Administratia Spitalelor si Serviciilor Medicale Bucuresti este un serviciu public, cu personalitate juridica, finantat din bugetul municipalitatii. Institutia asigura controlul modului de utilizarea a fondurilor catre spitale, propune modificarea structurii organizatorice, restructurarea, schimbarea sediului, precum si denumirile pentru spitalele publice, cu avizul Ministerului Sanatatii. (mai multe detalii gasiti pe site-ul institutiei:&nbsp;<a href="http://www.assmb.ro/" target="_blank">http://www.assmb.ro</a>)</em></p>\r\n\r\n<p><em>&nbsp; &nbsp; &nbsp;Managementul spitalului de copii Dr. Victor Gomoiu are drept scop furnizarea celor mai bune servicii medicale, un etalon al profesionalismului si calitatii. Astfel preocuparile managementului se axeaza pe: obtinerea satisfactiei pacientilor, perfectionarea continua a personalului, asiguarea unor activitatii educationale de inalt nivel si promovarea cercetarii</em></p>\r\n', ' ', '2019-04-09 09:34:01', '2019-04-09 09:34:22', '2019-04-09 09:50:27', '0df6e890-8524-4e0a-bd00-6661ae0ae591', '0df6e890-8524-4e0a-bd00-6661ae0ae591', '0df6e890-8524-4e0a-bd00-6661ae0ae591', '/content/uploaded/Gomoiu_old_4.jpg'),
(8, 'Povestea spitalului din Bariera Vergului', 'Povestea spitalului din Bariera Vergului', '<p><em>&nbsp;Planurile spitalului au fost elaborate initial de&nbsp;<a href="https://ro.wikipedia.org/wiki/Gheorghe_Simotta"><strong>Gheorghe Simotta</strong></a>, arhitect celebru in vreme, care a trait intre anii 1891-1979 si din creatia caruia fac parte Palatul Patriarhiei, Biserica Schitu Darvari si alte cladiri care au dat farmec Bucurestiului interbelic.</em></p>\r\n', ' ', '2019-04-09 09:51:56', '2019-04-09 09:54:44', NULL, '0df6e890-8524-4e0a-bd00-6661ae0ae591', '0df6e890-8524-4e0a-bd00-6661ae0ae591', NULL, '/content/uploaded/Gomoiu_old_4.jpg'),
(9, 'PROTECTIA DATELOR CU CARACTER PERSONAL', 'PROTECTIA DATELOR CU CARACTER PERSONAL', '<p>In conformitate cu Regulamentul general al Uniunii Europene privind protectia datelor (Regulamentul UE 2016/679, &ldquo;GDPR&rdquo;) care este aplicabil din data de 25 mai 2018,&nbsp;<a href="http://spitalgomoiu.ro/spital/">Spitalul clinic de copii Dr. Victor Gomoiu&nbsp;</a>,este operator de date cu caracter personal si va informeaza dupa cum urmeaza:</p>\r\n', ' ', '2019-04-09 09:53:02', '2019-04-09 09:54:28', NULL, '0df6e890-8524-4e0a-bd00-6661ae0ae591', '0df6e890-8524-4e0a-bd00-6661ae0ae591', NULL, '/content/uploaded/blog-gdpr_r.jpg');


